import React, { Component } from "react";
import ReactDOM from 'react-dom';
import PropTypes from "prop-types";

class Footer extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() {
        return (
            <div>
                <h4>{this.props.footer1}</h4>
                <h4>{this.props.footer2}</h4>
                <h4>{this.props.footer3}</h4>
                <h4>{this.props.footer4}</h4>
            </div>
        );
    }
}

export default Footer;
